import {useAuth} from "./AuthContext";


const ProtectedRoute = ({ isLoggedIn }) => {

    const { isAuthenticated, isAdmin } = useAuth();

    return <div>{isAuthenticated ? <Outlet /> : <Navigate to='/' />}</div>;
};

export default ProtectedRoute;
